class EndpointManager:
    def __init__(self, config_file=CONFIG_FILE, logger=None):
        self.config_file = config_file
        self.logger = logger
        self.endpoints = {}
        self.endpoint_connections = {}
        self.load_config()
        self.lock = threading.Lock()

    def load_config(self):
        try:
            with open(self.config_file, 'r') as f:
                config = json.loads(f.read())
                self.endpoints = config.get('models', {})

                for model, model_config in self.endpoints.items():
                    for endpoint in model_config.get('endpoints', []):
                        if endpoint not in self.endpoint_connections:
                            self.endpoint_connections[endpoint] = 0

            return True
        except Exception as e:
            return False

    def get_endpoint_connections(self, endpoint):
        with self.lock:
            return self.endpoint_connections.get(endpoint, 0)

    def increment_connections(self, endpoint):
        with self.lock:
            self.endpoint_connections[endpoint] = self.endpoint_connections.get(endpoint, 0) + 1

    def decrement_connections(self, endpoint):
        with self.lock:
            if endpoint in self.endpoint_connections and self.endpoint_connections[endpoint] > 0:
                self.endpoint_connections[endpoint] -= 1

    async def get_endpoints_for_model(self, model_name):
        if model_name in self.endpoints:
            return self.endpoints[model_name].get('endpoints', [])
        return []

    async def select_endpoint(self, model_name):

        endpoints = await self.get_endpoints_for_model(model_name)
        if not endpoints:
            return None

        min_connections = float('inf')
        min_endpoint = None

        connection_counts = {}

        for endpoint in endpoints:
            conn_count = self.get_endpoint_connections(endpoint)
            connection_counts[endpoint] = conn_count

            if conn_count < min_connections:
                min_connections = conn_count
                min_endpoint = endpoint


        return min_endpoint
